import React from 'react';

const WhaleIcon = ({ size = 24, className = '' }) => {
  return (
    <svg 
      width={size} 
      height={size} 
      viewBox="0 0 24 24" 
      fill="none" 
      xmlns="http://www.w3.org/2000/svg"
      className={className}
    >
      {/* 鲸鱼身体主体 - 蓝色紫色调 */}
      <path 
        d="M20 8C20 12 16 16 12 16C8 16 4 12 4 8C4 4 8 2 12 2C16 2 20 4 20 8Z" 
        fill="#6366f1"
      />

      {/* 鲸鱼身体内部 - 白色肚子 */}
      <path 
        d="M18 8C18 10.5 15.5 13 12 13C8.5 13 6 10.5 6 8C6 5.5 8.5 4 12 4C15.5 4 18 5.5 18 8Z" 
        fill="white"
      />

      {/* 鲸鱼眼睛 */}
      <circle cx="10" cy="7" r="1" fill="#1e293b" />

      {/* 鲸鱼嘴巴 */}
      <ellipse cx="12" cy="10" rx="2" ry="1.5" fill="#6366f1" />

      {/* 鲸鱼尾巴 - 向上指向 */}
      <path 
        d="M6 6L4 4L6 2L8 4L6 6Z" 
        fill="#6366f1"
      />

      {/* 鲸鱼尾巴装饰 */}
      <path 
        d="M5 3L7 5L5 7L3 5L5 3Z" 
        fill="#4f46e5"
      />
    </svg>
  );
};

export default WhaleIcon;
